description:
Executive Assistant Iris Vol. 2

English | CBZ | 139 Pages

Genre: Action/Adventure, Spy

Written by David Wohl
Art by Eduardo Francisco

Collects issues #0-5. Iris is back! The thrilling second volume to the critically acclaimed series EXECUTIVE ASSISTANT IRIS is available now in one action-packed collection! Following the death of her master Mr. Ching, Iris is nowhere to be found. Yet, the industry of EA's presses on without her under the corporate domination of a new threat to world security-the billionaire entrepreneur Duncan Villone. His strategy for control of not only the Executive Assistant's bodies, but also their minds sends ripples across multiple continents in this unrelenting tale of espionage and global conspiracy! Featuring appearances by popular EA's Rose, Lily, Lotus, Orchid and Violet, this is one trade paperback fans of EA, and new readers looking to join the fold, will not want to miss!

